import React, {Component} from 'react';

import './App.css';

class App extends Component {
  constructor(props) {
    super(props);
    this.state = { monsters: [
      {name: 'Monstert 1'},
      {name: 'Monstert 2'},
      {name: 'Monstert 3'},
      {name: 'Monstert 4'}
    ] 
   }
  }
  render() { 
    return (  
      <div>
        <h1>Twentek</h1>
        {this.state.monsters.map((monster) => {
          return (
            <div key={monster.name}>
              <h3>{monster.name}</h3>
            </div>
          )
        })}
      </div>
    );
  }
}


export default App;
